import { useState } from "react";
import "./css/App.css";
import InitRoutes from "./routes/navigation_routes/InitRoutes";

function App() {
  const [logged, setLogged] = useState(true);
  const changeLoginState = () => {
    setLogged(!logged);
  };
  return (
    <InitRoutes
      isLoggedIn={logged}
      handleChange={changeLoginState}
    ></InitRoutes>
  );
}
export default App;
